import React from 'react';
import { Table } from 'reactstrap';
import danhsach from '../data';

export default class Cart extends React.Component {
    constructor(props){
        super(props);
        this.state={
            items:danhsach.items,
        }
    }
  render() {
      const list=this.state.items;
      const printList=
      <tbody>
      <tr>
        <th scope="row">
         <img src={list[0].src} alt={list[0].caption}/>
        </th>
        <td>Mark</td>
        <td>Otto</td>
        <td>@mdo</td>
        <td>@mdo</td>
      </tr>
    </tbody>
    return (
      <Table>
        <thead>
          <tr>
            <th></th>
            <th>Sản phẩm</th>
            <th>Giá</th>
            <th>Số lượng</th>
            <th>Tạm tính</th>
          </tr>
        </thead>

      </Table>
    );
  }
}
